import ApartmentIcon from "../images/ApartmentIcon.svg"
import AttractionIcon from "../images/AttractionIcon.svg"
import OutdoorsIcon from "../images/OutdoorsIcon.svg"
import ParkIcon from "../images/ParkIcon.svg"
import ClubIcon from "../images/ClubIcon.svg"

export const generateId = () => {
    // Math.random should be unique because of its seeding algorithm.
    // Convert it to base 36 (numbers + letters), and grab the first 9 characters
    // after the decimal.
    return '_' + Math.random().toString(36).substr(2, 15);
  }

export const determineWhichIcon = string => {
  switch (string) {
    case "Apartment":
      return ApartmentIcon
    case "Tourist Attractions":
      return AttractionIcon
    case "Outdoors":
      return OutdoorsIcon
    case "Parks":
      return ParkIcon
    case "Nightlife":
      return ClubIcon
    default:
      return "All"
  }
}
